function Start()
	Hydra.Wait(1);

	while true do
		-- Find valid players
		local tPlayer = Hydra.PlayerActors();
		for i, idPlayer in ipairs(tPlayer) do
			if Hydra.ActorIsValid(idPlayer) then
				local idPulse = Hydra.ActorFindNearestActor(idPlayer, 60, true, true, Hydra.ReferenceActor("Dungeon_Affix_LightningPulse"));
				if Hydra.ActorIsValid(idPulse) then
					gid_Pulse = idPulse;
					return;
				end
			end
		end
		
		Hydra.Wait(0.5);
	end
end

function Start(flGameTime)
	if not Hydra.ActorIsValid(gid_Pulse) then
		return;
	end

	local idPlayer = Hydra.ActorGetClosestPlayer(gid_Pulse);
	if not Hydra.ActorIsValid(idPlayer) or not Hydra.ActorIsAlive(idPlayer) then
		return;
	end
	
	if Hydra.ActorDistanceSquaredBetweenActors(idPlayer, gid_Pulse) > 625 then
		Hydra.ActorTriggerPowerAtTarget(gid_Pulse, idPlayer, Hydra.ReferencePower("Dungeon_Affix_LightningPulse_Teleport"));
	end
end
